import { configureStore } from '@reduxjs/toolkit'
import authSlice from './features/authSlice'
import cartSlice from './features/cartSlice'

// create a new store
export const store = configureStore({
  reducer: {
    auth: authSlice,
  },
  reducer: {
    cartReducer : cartSlice,
  },

})
